import React, { lazy, Suspense, useState } from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";

const Layout = lazy(() => import("../Layout/Layout"));
const Home = lazy(() => import("../Pages/Home"));
const Router = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route
          path="/"
          element={
            <Layout>
              <Suspense>
                <Home />
              </Suspense>
            </Layout>
          }
        />


        <Route
          path="/about-us"
          element={
            <Layout>
              <Suspense>
                <AboutUs />
              </Suspense>
            </Layout>
          }
        />

      </Routes>
    </BrowserRouter>
  );
};

export default Router;
